import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import Layout from '../components/main/layout';
import Hero from '../components/main/hero';
import GreenPost from '../components/main/greenpost';
//import MainSection from '../components/main/main';
//import Embajadores from '../components/main/embajador';
//      <Embajada />
import Embajada from '../components/main/embajada';
import Events from '../components/main/events';
import Post from '../components/layout/post';
import Title from '../components/main/title';
import { color, font } from '../layout/var';
import AOS from 'aos';
import { TweenMax } from 'gsap';

const Ale = () => {
  useEffect(()=> {
    AOS.init;
    //TweenMax.to('#comparte', 7, { strokeDashoffset:0, delay: 3.5 });
  },[])
  return(
    <div className="main">
      <Title word="La mas hermosa" />
      <div data-aos="fade-in" data-aos-delay="500" className="cont">
        <div className="image">

        </div>
        <div className="info">
          <svg width="376px" height="60" className="hero_comparte">
            <text id="comparte" fill="none" stroke="#000" strokeWidth="1px" strokeDasharray="600px" strokeDashoffset="600" fontWeight="900" fontSize="40px" x="0" y="50">Alejandra Rojas</text>
          </svg>
          <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Sint maiores, voluptas nihil labore asperiores minima rerum nemo. Aspernatur adipisci sunt corporis dolorem blanditiis, quo vero? Voluptate minus temporibus, adipisci doloribus?</p>
        </div>
      </div>
      <style jsx>{`
        .cont{
          //display: flex;
          //flex-direction: column;
          height: 100vh;
        }
        .image{
          background: url(/static/alejandra.jpg)top center no-repeat;
          background-size: cover;
          width: 100%;
          height:70%;
        }
        .info{
          display: flex;
          flex-direction: column;
          align-items: center;
        }
        .info h1{
          color: ${color.prim};
          font-weight: 900;
        }
      `}
      </style>
    </div>
  )
}

const Main = () => {
  const postVisible = useSelector(state => state.post.visible);
  return(
    <Layout>
      <Hero />
      <Embajada />
      <Events />
      <Ale />
      <GreenPost />
      { postVisible && <Post /> }
    </Layout>
  )
}

export default Main;
